using System;
using System.Threading.Tasks;
using Xunit;
using Moq;
using Microsoft.Extensions.Logging.Abstractions;
using SolicitacaoViaRG.BLL;
using SolicitacaoViaRG.BLL.DTO;
using SolicitacaoViaRG.Data.Model;
using SolicitacaoViaRG.Data.Repository.Interface;

namespace SolicitacaoViaRG.Tests
{
    public class ProtocoloBLLTests
    {
        private readonly Mock<IProtocoloRepository> _protocoloRepositoryMock;
        private readonly ProtocoloBLL _protocoloBLL;

        public ProtocoloBLLTests()
        {
            _protocoloRepositoryMock = new Mock<IProtocoloRepository>();
            _protocoloBLL = new ProtocoloBLL(
                _protocoloRepositoryMock.Object,
                "./images",
                new NullLogger<ProtocoloBLL>()
            );
        }

        [Fact]
        public async Task BuscarProtocolosAsync_DeveRetornarListaDeProtocolos()
        {
            // Arrange
            var numeroProtocolo = "12345";
            var cpf = "12345678901";
            var rg = "1234567";
            var protocolos = new[]
            {
                new Protocolo { NumeroProtocolo = numeroProtocolo, Cpf = cpf, Rg = rg }
            };
            _protocoloRepositoryMock.Setup(repo => repo.BuscarProtocolosAsync(numeroProtocolo, cpf, rg))
                                    .ReturnsAsync(protocolos);

            // Act
            var result = (await _protocoloBLL.BuscarProtocolosAsync(numeroProtocolo, cpf, rg)).ToList();

            // Assert
            Assert.NotNull(result);
            Assert.Single(result);
            Assert.Equal(numeroProtocolo, result[0].NumeroProtocolo);
            Assert.Equal(cpf, result[0].Cpf);
            Assert.Equal(rg, result[0].Rg);
        }

        [Fact]
        public async Task SalvarProtocoloAsync_DeveSalvarProtocoloComSucesso()
        {
            // Arrange
            var protocoloDto = new ProtocoloDto
            {
                NumeroProtocolo = "12345",
                Cpf = "12345678901",
                Rg = "1234567",
                Nome = "Teste",
                Foto = _fotoFake // Simulando uma imagem base64
            };

            _protocoloRepositoryMock.Setup(repo => repo.GetByNumeroProtocoloAsync(protocoloDto.NumeroProtocolo))
                                    .ReturnsAsync((Protocolo)null);
            _protocoloRepositoryMock.Setup(repo => repo.GetByCpfAsync(protocoloDto.Cpf))
                                    .ReturnsAsync((Protocolo)null);
            _protocoloRepositoryMock.Setup(repo => repo.GetByRgAsync(protocoloDto.Rg))
                                    .ReturnsAsync((Protocolo)null);

            // Act
            await _protocoloBLL.SalvarProtocoloAsync(protocoloDto);

            // Assert
            _protocoloRepositoryMock.Verify(repo => repo.AddProtocoloAsync(It.IsAny<Protocolo>()), Times.Once);
        }

        [Fact]
        public async Task SalvarProtocoloAsync_NaoDeveAceitarProtocoloComMesmoNumero()
        {
            // Arrange
            var protocoloDto = new ProtocoloDto
            {
                NumeroProtocolo = "12345",
                Cpf = "12345678901",
                Rg = "1234567",
                Nome = "Teste",
                Foto = _fotoFake // Simulando uma imagem base64
            };

            _protocoloRepositoryMock.Setup(repo => repo.GetByNumeroProtocoloAsync(protocoloDto.NumeroProtocolo))
                                    .ReturnsAsync(new Protocolo { NumeroProtocolo = "12345" });

            // Act & Assert
            var exception = await Assert.ThrowsAsync<Exception>(() => _protocoloBLL.SalvarProtocoloAsync(protocoloDto));
            Assert.Equal("Protocolo com o mesmo número já existe.", exception.Message);
        }

        [Fact]
        public async Task SalvarProtocoloAsync_NaoDeveAceitarCpfRgComMesmoNumeroVia()
        {
            // Arrange
            var protocoloDto = new ProtocoloDto
            {
                NumeroProtocolo = "12345",
                Cpf = "12345678901",
                Rg = "1234567",
                NumeroVia = 1,
                Nome = "Teste",
                Foto = _fotoFake 
            };

            _protocoloRepositoryMock.Setup(repo => repo.GetByNumeroProtocoloAsync(protocoloDto.NumeroProtocolo))
                                    .ReturnsAsync((Protocolo)null);
            _protocoloRepositoryMock.Setup(repo => repo.GetByCpfAsync(protocoloDto.Cpf))
                                    .ReturnsAsync(new Protocolo { Cpf = "12345678901", NumeroVia = 1 });
            _protocoloRepositoryMock.Setup(repo => repo.GetByRgAsync(protocoloDto.Rg))
                                    .ReturnsAsync(new Protocolo { Rg = "1234567", NumeroVia = 1 });

            // Act & Assert
            var exception = await Assert.ThrowsAsync<Exception>(() => _protocoloBLL.SalvarProtocoloAsync(protocoloDto));
            Assert.Equal("CPF com o mesmo número de via já existe.", exception.Message);
        }
        private readonly string _fotoFake = "";
    }
}
